 function Gerar_pdf(){
  var doc = new jsPDF('p', 'mm');

  var dom = new Object();
  dom.title = document.querySelector('.title').innerHTML;
  dom.info_pdf = function(){
    var rescrita = dom.title.replace("Relatório", "");
    if(rescrita == true){
      return rescrita;
    }
    dom.texto = 'Relatório: ' +  rescrita;
    dom.datatime = 'gerado em: ' + new Date().toLocaleString(); 
    return dom.texto + ' - ' + dom.datatime;
  }
  console.log(dom.title.caption);
  dom.construct_pdf = function() {
    var dataUrl = 'data:image/png;base64,';
    doc.setFontSize(11);
    doc.addImage(dataUrl,'PNG',18,4,50,26);
     doc.text(dom.info_pdf(), 14, 40);
    doc.autoTable({html: '#HTML', columnStyles: {0: {halign: 'center'}},styles: {halign: 'center',fillColor:'#284B8F',textColor:'white'},startY:45,pageBreak:'auto',theme: 'grid'});
    window.open(doc.output('bloburl'), '_blank');
  }
  dom.construct_pdf();
}